import PropTypes from 'prop-types';
import classNames from 'classnames';

class Footer extends React.Component {
  render() {
    return (
      <footer className='footer'>
        This is a footer
        <style jsx>{`
          .footer {
            grid-area: footer;
          }
        `}</style>
      </footer>
    )
  }

}

export default Footer
